import React, {useState} from 'react';
import axios from "axios";

function Form2() {

    const [secondStep, setSecondStep] = useState({
        telephone: "",
        birth: ""
    })

    const [select, setSelect] = useState("Please choose your gender")

    function handleChange(event) {
        const {value, name} = event.target
        setSecondStep((prevValue) => {
            return {
                ...prevValue,
                [name]: value
            }
        })
    }

    function handleClick(event) {
        event.preventDefault();
        const stepTwo = {
            telephone: secondStep.telephone,
            gender: select,
            birth: secondStep.birth
        }
        axios.post("http://localhost:3001/create", stepTwo)
    }

    function handleChangeSelect(event) {
        const selectedGender = event.target.value
        setSelect(selectedGender)
    }

    return (
        <div>
            <form>
                <label className="form-label">
                    <div onChange={handleChange} value={secondStep.telephone} className="form">
                        <div>
                            <h3>Telephone number</h3>
                            <input type="text" name="telephone" onChange={handleChange} value={secondStep.telephone} />
                        </div>
                        <div>
                            <h3>Gender</h3>
                            <select onChange={handleChangeSelect} value={select}>
                                <option value="female">Female</option>
                                <option value="male">Male</option>
                                <option value="I prefer not to say">I prefer not to say</option>
                            </select>
                        </div>
                        <div>
                            <h3>Date of birth</h3>
                            <input onChange={handleChange} value={secondStep.birth} placeholder="../../...." name="birth" type="text" />
                        </div>
                    </div>
                    <button onClick={handleClick} type="submit">Next ></button>
                </label>
            </form>
        </div>
    )
}

export default Form2
